import React from "react";
import { Row, Col, Stack, Container } from "react-bootstrap";
import { UserContext } from "../context/userContext";
import { useContext } from "react";
import { API } from "../config/api";
import { useQuery } from "react-query";

//images
import PhotoProfile from "../img/blank-profile.png"
import logo from "../img/group.png"
import barcode from "../img/tsbarcode.png"


const Profile = () => {

    const [state] = useContext(UserContext);

    let { data: ProfileTransactions } = useQuery(
      "transactionsCache",
      async () => {
        const response = await API.get("/user-transaction");
        return response.data.data;
      }
    );

    let { data: Profile } = useQuery("profileCache", async () => {
      const response = await API.get("/user-profile");

      return response.data.data.profile;
    });


    return (
        <Stack direction="horizontal" gap={3} >
            <div className="jumboContainer">
                <Container>
                <Row>
                    <Col>
                    <p className='h3'>My Profile</p>
                    <Stack direction="horizontal" gap={4}>
                    <div>
                    <img src={
                        Profile?.image === "http://localhost:5000/uploads/"
                        ? PhotoProfile
                        : Profile?.image
                    } alt=""/>
                    </div>
                    <div className="align-self-start">
                    <ul>
                        <li className="biodataTitle">FULL NAME</li>
                        <li className="biodataContent">{state.user.fullname}</li>
                        <li className="biodataTitle">Email</li>
                        <li className="biodataContent">{state.user.email}</li>
                        <li className="biodataTitle">Address</li>
                        <li className="biodataContent">{Profile?.address}</li>
                        <li className="biodataTitle">Postal Code</li>
                        <li className="biodataContent">{Profile?.postal_code}</li>
                    </ul>
                    </div>
                    </Stack>
                    </Col>

                    <Col>
                    <p className="h3">My Transaction</p>
                    {ProfileTransactions?.map((item, index) => (
                    <Stack direction="horizontal" gap={4} style={{backgroundColor: "#F7DADA", borderRadius: "10px"}}>
                       <div  className={item?.status === "" ? "fd" : "profileCard mb-5"} key={index} >
                            <div className="contentCardLeft">
                            {item?.carts?.map((cart, idx) => (
                                <Stack direction="horizontal" gap={3} className="pt-4 pb-1 px-4" key={idx}>
                                    <div>
                                        <img src={"http:localhost:5000/uploads/"+ cart?.product?.image} alt=""></img>
                                    </div>

                                    <div className="align-self-start">
                                    <p className="fw-bold mb-0" style={{color: "#BD0707", fontSize: "14px"}}>{cart?.product?.title}</p>
                                    <p className="my-1" style={{color: "#BD0707", fontSize: "9px"}}><b>Saturday,</b> 5 March 2020</p>
                                    <p className="mt-3 mb-1" style={{color: "#BD0707", fontSize: "9px"}}>
                                    <strong>
                                    Toping : {" "}
                                    {cart.topping.map((topping, idx) => (
                                       <span key={idx}>{topping?.title},</span>
                                    ))}
                                    </strong>  
                                   </p>
                                    <p className="mt-2" style={{color: "#BD0707", fontSize: "9px"}}><span>Price : </span>{cart?.product?.price}</p>
                                    </div>
                                </Stack>
                            ))}
                            </div>

                            <div className={
                                item?.status === "Success"
                                ? "contentCardRight Success"
                                : item?.status === "Cancel"
                                ? "contentCardRight Cancel"
                                : item?.status === "pending"
                                ? "contentCardRight Pending"
                                : "contentCardRight Otw"
                            }>
                                <img src={logo} alt="" className="ms-4 d-flex justify-content-end" style={{ width: "47px"}}></img>
                                <img src={barcode} alt="" className="pt-4 ms-3 d-flex justify-content-end"></img>
                                <p className="p-2 bg-info mt-2 ms-3" style={{color: "blue", fontSize: "9px", width: "75px"}}>{item?.status}</p>
                                <p className="mt-2 fw-bold d-flex justify-content-end" style={{color: "#BD0707", fontSize: "12px"}}><span>Sub Total :</span>{item?.total}</p>
                            </div>
                        </div>
                    </Stack>   
                    ))}
                    </Col>

                </Row>
                </Container>
            </div>
        </Stack>
    )
}

export default Profile
